function record(v){
recognition.start();
recognition.onresult = event => {
  const speechToText = event.results[event.results.length - 1][0];
  let text = speechToText.transcript;
if(v!=1){
document.querySelector(".cE").innerHTML += text;
}else{
document.querySelector("#search-input").value = text;
  if (/your name|ok google|who are you/i.test(text))
   {
    speak(whoYou());
  }else if (/good morning/i.test(text))
  {
    speak("Good morning! I hope you have a great day!");
  } 
  else if (/thank/i.test(text))
  {
    speak(thankyou());
  }
  else {
    speak(` I'm searching for ${text}`);
    document.querySelector("#search-form").submit();
  }
};
}
}

function whoYou(){
const whoyou = [
    "I am here to assist you as your 3schools Assistant.",
    "I am your 3schools Assistant. A new way to interact with 3schools.",
    "I am your 3schools Assistant. How can I help you?",
    "I am your 3schools Assistant. You have definitely heard my name.",
];
    return `${whoyou[Math.floor(Math.random()*whoyou.length)]}`;
}
function thankyou(){
   const thank = [
    "Wow, thank you so much. This is what I'm here for.",
    "Does anyone ever thank a friend?",
    "I'm very happy to be able to help you.",
];
    return `${thank[Math.floor(Math.random()*thank.length)]}`;
}

function speak(text) {
  window.speechSynthesis.cancel();
  let msg = new SpeechSynthesisUtterance(text);
  msg.lang = 'en-IN';
  msg.pitch = 1; 
  msg.volume = 1; 
  window.speechSynthesis.speak(msg);
  return;
}
